require 'rails_helper'

RSpec.describe "Api::IdentitiesControllers", type: :request do
  describe "GET /index" do
    context "When user is logged in" do
      before do
        authorize_user

        get '/api/identities', as: :json
      end

      it "returns http success" do
        expect(response.status).to eq(200)
      end
    end

    context "When user is not logged in" do
      before do
        get '/api/identities', as: :json
      end

      it "returns http unauthorized" do
        expect(response.status).to eq(401)
      end
    end

    context "creates identity" do
      let(:user) { authorize_user }

      let(:identity) { create(:domain, domain_number: 1501, name: 'Identity Type') }
      let(:identity_type) { create(:domain_reference, domain: identity, role: %W[#{user.user_role.role.id}], display: "Driver's License") }
      let(:file) {
        "data:image/jpeg;base64,"
      }

      before do
        headers = { 'CONTENT_TYPE' => 'application/json' }
        params = {
          "identity": {
            "identity_type_id": identity_type.id,
            "id_number": Faker::IDNumber.valid,
            "file": file
          }
        }

        post '/api/identities', params: params, as: :json, headers: headers
      end

      it "returns http created" do
        expect(response.status).to eq(200)
      end

      it "returns json" do
        expect(response.content_type).to eq('application/json; charset=utf-8')
      end
    end
  end
end
